class Solution:
    results = {}

    def valid_str(self, left, right):
        s = str(left) + "_" + str(right)
        found = False
        if s in self.results:
            if self.results[s].nchars_needed == 0:
                return True
            else:
                return False
        else:
            s1 = str(left) + "_" + str(right-1)
            # s2 = str(left - 1) + "_" + str(right)
            if s1 in self.results:
                if self.results[s1]["nchars_needed"] == 0:
                    self.results[s1]["nchars_needed"] = 0
                    return True
                else:
                    found = True
                    left = right - 1
                    chars = self.results[s1]["chars"]
                    nchars_needed = self.results[s1]["nchars_needed"]
            # if s2 in self.results:
            #     if self.results[s2].nchars_needed == 0:
            #         self.results[s2].nchars_needed = 0
            #         return True
            #     else:
            #         left = right - 1
            #         chars = self.results[s2].chars
            #         nchars_needed = self.results[s2] = nchars_needed
        if not found:
            chars = {}
            nchars_needed = len(self.t)
            for c in self.t:
                if c not in chars:
                    chars[c] = 0
                chars[c] += 1
        if right >= len(self.charsLocList):
            return False
            
        for i in range(left, right+1):
            c = self.s[self.charsLocList[i]]
            if c in chars and chars[c] > 0:
                chars[c] -= 1
                nchars_needed -= 1
                if nchars_needed == 0:
                    s = str(left) + "_" + str(right)
                    self.results[s] = {}
                    self.results[s]["nchars_needed"] = 0
                    return True
        s = str(left) + "_" + str(right)
        self.results[s] = {}
        self.results[s]["chars"] = chars
        self.results[s]["nchars_needed"] = nchars_needed
        return False

    def minWindow(self, s: str, t: str) -> str:
        self.results.clear()
        if len(s) == 0:
            return ""
        self.s = s
        self.t = t
        charsNeeded = {}
        for c in t:
            if c not in charsNeeded:
                charsNeeded[c] = []

        charsLocList = []
        for i in range(len(s)):
            c = s[i]
            if c in charsNeeded:
                charsNeeded[c].append(i)
                charsLocList.append(i)

        self.charsLocList = charsLocList

        min_char = t[0]
        min_len = len(charsNeeded[ t[0] ])

        for c in charsNeeded:
            l = len(charsNeeded[c])
            if l < min_len:
                min_char = c
                min_len = l
        
        lefti = 0
        righti = 0

        minleft = -1
        minright = -1
        mindistance = len(s) + 1
        
        charsloclen = len(charsLocList)
        if charsloclen == 0:
            return ""

        result = self.valid_str(lefti, righti)
        if result:
            d = charsLocList[righti] - charsLocList[lefti]
            if d < mindistance:
                minleft = charsLocList[lefti]
                minright = charsLocList[lefti]
                mindistance = minright - minleft

        while True:
            while righti < charsloclen - 1:
                righti += 1
                result = self.valid_str(lefti, righti)
                if result:
                    d = charsLocList[righti] - charsLocList[lefti]
                    if d < mindistance:
                        minleft = charsLocList[lefti]
                        minright = charsLocList[righti]
                        mindistance = minright - minleft
                    break
            
            while lefti < charsloclen - 1:
                lefti += 1
                result = self.valid_str(lefti, righti)
                if result:
                    d = charsLocList[righti] - charsLocList[lefti]
                    if d < mindistance:
                        minleft = charsLocList[lefti]
                        minright = charsLocList[righti]
                        mindistance = minright - minleft
                else:
                    lefti -= 1
                    break
            
            if righti == charsloclen - 1:
                break
        
        # print(minleft, minright, mindistance)
        # print(self.valid_str(charsLocList, left, len(charsLocList)-1))
        return s[minleft:minright+ 1]
        
